// background
var fade = "data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAEAAAENCAYAAADOoA9GAAAABGdBTUEAAK/INwWK6QAAABl0RVh0U29mdHdhcmUAQWRvYmUgSW1hZ2VSZWFkeXHJZTwAAABZSURBVHjaYmBgYPjPACP+MYFIEPEflfUflwQRSojgUiyGX4IkJTTRi5P4R39T/tFByT8qa6OJof8GPJgGPjHQI/FTki+pWFCQXlQhsZiBmBFMwLlgwAgQYAAYPe0bQ81rlgAAAABJRU5ErkJggg=="


// Main logo data
var logo = "data:image/png;base64,"


// Small logo data
var logo2 = "data:image/png;base64,"


// transparent Goooooooooooogle
var logo3 = "data:image/png;base64,"


// Shopping logo
var logo4 = "data:image/png;base64,"


// tiny google
var logo5 = "data:image/png;base64,"


// Dark main logo
$('img#hplogo').attr('src',''+logo);

// Buttons under main logo
$('form#tsf div.tsf-p div.jsb center input').css('background-color','black');

// Text under main logo
$('div#prm').css('color','#858585');


// Search result logo
$('a#logo img').css('background','none repeat scroll 0 0 #111111');
$('a#logo img').attr('width','115');
$('a#logo img').attr('height','45');
$('a#logo img').css('top','0px');
$('a#logo img').attr('src',''+logo2);

// Advanced search
$('body table tbody tr td a img').not('img.th').attr('src',''+logo2);
$('div.outer-box form.block div h3').css('color','#858585');
$('td.page-title').css('background','#262626');
$('html body table tbody tr td table tbody tr td').attr('bgcolor','#262626');
$('div.qbuilder-env').css('background','#444444');

// Google doodles
if (window.location.pathname.match("\/logos*")) {
   $('div.g-section h1 a').css('background','url('+logo2+') no-repeat scroll 0 0');
};

// Translate
$('#gt-logo').css('background','#000000');
$('form#gt-form textarea').css('background','white');
$('div#gt-src-tools').css('background','white');
$('div#gt-src-tools').css('margin-top','0px');

// Goooooooooooogle
$(window).scroll(function() {
   $('span.csb').css('background','url('+logo3+') no-repeat scroll 0 0 transparent');
      $('td span.csb:eq(0)').css('background-position','-24px 0');	//G
      $('td.b a span.ch').css('background-position','0px 0');		//<G
      $('span.csb:gt(0)').css('background-position','-74px 0');		//o
      $('td.cur span.csb').css('background-position','-53px 0');	//selected o
      $('span.csb:last').css('background-position','-96px 0');		//gle>
});


// Shopping
$('div#kd-googlebar div.logo a img').attr('src',''+logo4);
$('div#kd-googlebar div#kd-appswitcher a#pp-logo img').attr('src',''+logo4);
$('div#kd-googlebar').css('background','#161616');
$('div#prodbar').css('background','#000000');
$('div#prodbar').css('box-shadow','0 9px 18px #000000');
$('div#prodbar div.prodbar-content div.prodbar-info div.product-attr').css('color','#777777');
$('body').mousemove(function() {
   $('div#main.main-block div div p').css('color','#858585');
   $('div#main.main-block div div ul li div a div p').css('color','#858585');
});


// Greasemonkey style mods
x = 'body {;background: #262626 url("'+fade+'") top left repeat-x !important;color: #fff !important; font-family:segoe ui !important; font-style: italic !important;}';
x += 'span.a { color: #1160CC !important;}';
x += 'div{color:#fff;}';
x += 'td,.n a,.n {color:#64ABFB !important;}';
x += 'a#logo { font-size: 0 !important; }';
x += '#gbi { background: #444 !important; border-color: #000 !important; }';
x += '#gbar .gb2 a:hover { background: #FFF !important; color: #FFF !important; }';
x += '#gbh, .gbh { border: none !important; }';
x += '.gb2 div { border-color: #FFF !important; }';
x += '.w_ind, .tld{ color:black !important;}';
x += '#footer_promos {display: none !important;}';
x += 'th {color: 64ABFB !important;}';
x += '#navbar img { visibility: hidden !important; }';
x += '#navbar * { background-image: none !important; }';
x += '#ssb, #bsf, .gb2, .gac_c, .gac_d, .gac_e, .gac_k {background-color: #555 !important;}';
x += '#leftnav, #tbd, #guser, #rshdr, .rshdr, .tpblk, #rgsh_s  {background-color: transparent !important;}';
x += 'ol#rso li div div span {color: #858585}';
x += 'ol#rso li div div span em {color: #957A77}';
x += 'div#appbar { background: #121212}';
x += 'ol#rso li div div table tbody tr td h3 a em {color: #32557d}';
x += 'ol#rso li div div div a em {color: #32557d}';
x += 'ol#rso li div span span {color: #32557d}';
x += 'ol#rso li div div ul li {color: #32557d}';
x += 'body#srp table tbody tr td table tbody tr td table {background-color: #333333}';
x += 'td#sftab.lst-td div.lst-d table.lst-t { background: black}';
x += 'input#lst-ib { background: black !important; }';
x += 'input#lst-ib  {visibility: visible}';
x += 'input#lst-ib  {color: #FFFFFF !important; }';
x += 'div.sfbgg {background: #111111}';
x += 'table.gssb_e {background: #222222}';
x += 'div {color: #858585}';


// Specifically for Images tab
x += 'div.rgsh {background: #3d150f}';
$('body').ready(function() {
   $('div#qbc input.lst').css('background','black');
   $('div#qbc input.lst').css('color','white');
});


// Specifically for Video tab
if (window.location.hostname.match("video\.google\.*")) {
   $('body center img').attr('src',''+logo);
   $('div#headerdiv table tbody tr td a img').attr('src',''+logo2);
   $('body#GooglePage.GooglePage div.div-footer').css('background-color','#262626');
   $('body#GooglePage.GooglePage center form#as_form table tbody tr:lt(4)').attr('bgcolor','#151515');
   x += 'input#q.search-input {background-color: black}';
   x += 'table#completeTable.google-ac-m {background-color: #222222}';
   x += 'table#completeTable.google-ac-m {border: 1px solid #64ABFB}';
   x += 'tr.google-ac-a {background-color: #222222}';
   x += 'input#q.search-input {color: white}';
};


// iGoogle
if (window.location.pathname.match("\/ig")) {
   $('div#doc3 div#bodyContainer.G-NS div.G-MS').css('background-color','#333333');
   $('div#doc3 div#bodyContainer.G-NS div.G-MS div.G-DT table.G-AT tbody tr td.G-OS').css('background-color','#222222');
   $('div#doc3 div#nhdrwrap.header_tile_image').css('background-color','black');
   $('div#doc3 div.footerwrap div.footerwrapperinner').css('background-color','black');

// flights
} else if (window.location.pathname.match("\/flights\/")) {
   $('body').ready(function() {
      $('div.gwt-Label').not('.GDKNS5FCH4').css('color','#858585');
      $('a.GDKNS5FCO3').not('.GDKNS5FCL3').children('span').css('color','#858585');
      $('div.GDKNS5FCP3').css('color','#858585');
   });
   $('body').click(function() {
      $('div.gwt-Label').not('.GDKNS5FCH4').css('color','#858585');
   });
   x += 'div.GDKNS5FCLK {background-color: #121212;}';
   x += 'a.GDKNS5FCCK {color: #999999;}';

// firefox
} else if (window.location.pathname.match("\/firefox")) {
   x += 'a {color: #999999;}';
   $('table#frame tbody div[title~="Firefox"]').parent().remove();
   $('table#frame tbody div[title~="Google"]').remove();
   $('table#frame tbody tr:eq(8)').remove();
   $('table#frame tbody tr:eq(1) td table tbody tr td div').replaceWith('<div></div>');
   $('table#frame tbody tr:eq(1) td table').css('width','20%');
   $('table#frame tbody tr:eq(1) td table').css('margin-left','35%');
   $('table#frame tbody tr:eq(1) td table').css('margin-right','45%');
   $('table#frame tbody tr:eq(1) td table tbody tr td div').after('<img id="brandStartLogo" src="chrome://branding/content/about-logo.png" alt=""/>');
   $('img#brandStartLogo').parent().attr('bgcolor','');
   $('img#brandStartLogo').css('height','115px');
   $('table#frame tbody tr:eq(3) td table tbody tr td:eq(1) table tbody tr td:eq(1) table:first tbody').replaceWith('<img alt="Google" src='+logo5+' id="searchEngineLogo">');
   $('input#sf').css('background','black');
   $('input#sf').css('color','white');
   $('table#frame tbody tr:eq(3) td table tbody tr td').attr('bgcolor','#181818');


// rest of google pages
} else {
   x += 'a:link, .link {color: #64ABFB;}';
   x += 'a:active, .link:active { color: #1160C7 !important; }';
   x += 'a:visited, .mitem a, a#showmodes, a.fl, a.q, div.psfilter label, div#fll a, span#fblmi a, a.slink{color:#999 !important;}';
   x += 'ul.nojsb {background : #262626 !important;}';
   x += 'div.tbtctlabel {color: #858585}';
};


// Add in all the greasemonkey style mods
GM_addStyle(x);


